Content:
Feria Valencia cuenta con la mayor superficie de exposición de España y unos de los diez mayores del mundo con una superficie total superior a los 230.000 metros cuadrados.

Feria Valencia ofrece la posibilidad de celebrar ferias, convenciones, congresos, seminarios, reuniones, conciertos y todo tipo de eventos con capacidad de hasta 20.000 personas y alcanzando el centenar de eventos nacionales e internacionales que atraen a un millón de visitantes de todos los rincones del mundo.

&nbsp;

Ifeja, es una empresa que nace por iniciativa pública y privada de la sociedad jiennense para gestionar el Recinto Provincial de Ferias y Congresos que había sido construido por el Consorcio para el Desarrollo de la Provincia de Jaén.

El Recinto de Ferias, Exposiciones y Congresos de Jaén (Ifeja) cuenta con uno de los Recintos más modernos de España, dotado de las últimas innovaciones tecnológicas y de comunicación.

&nbsp;

FIBES es el espacio de referencia para el desarrollo de grandes eventos económicos, culturales, sociales y profesionales.

Generando crecimiento en Sevilla desde 1989, FIBES es hoy día el <em>think tank</em> desde donde debatir, reflexionar e impulsar proyectos innovadores que construyen un futuro más verde y más inteligente.

&nbsp;

